const sourceCode = "---\nsidebarTitle: Tabs\n---\n\n# Tabs Component\n\nA built-in component provided by `nextra-theme-docs`.\n\n## Example\n\nimport { Tabs } from 'nextra/components'\n\n<Tabs items={['JavaScript', 'C++', {label:'C', disabled: true}, 'Python']} defaultIndex={1}>\n  <Tabs.Tab>\n    ```js filename=\"hi.js\"\n    import { useState, useEffect } from 'react';\n    ```\n  </Tabs.Tab>\n  <Tabs.Tab>\n    ```cpp filename=\"hi.cpp\"\n    #include <iostream>\n    ```\n  </Tabs.Tab>\n  <Tabs.Tab>\n    ```c filename=\"hi.c\"\n    #include <stdio.h>\n    ```\n  </Tabs.Tab>\n  <Tabs.Tab>\n     ```python filename=\"hello.py\"\n    print('Hello, world!')\n    ```\n  </Tabs.Tab>\n</Tabs>\n\n## Usage\n\n### MDX component\n\n````mdx filename=\"tabs.mdx\"\n<Tabs items={['JavaScript', 'C++', {label:'C', disabled: true}, 'Python']} defaultIndex={1}>\n  <Tabs.Tab>\n    ```js filename=\"hi.js\"\n    import { useState, useEffect } from 'react';\n    ```\n  </Tabs.Tab>\n  <Tabs.Tab>\n    ```cpp filename=\"hi.cpp\"\n    #include <iostream>\n    ```\n  </Tabs.Tab>\n  <Tabs.Tab>\n    ```c filename=\"hi.c\"\n    #include <stdio.h>\n    ```\n  </Tabs.Tab>\n  <Tabs.Tab>\n    ```python filename=\"hello.py\"\n    print('Hello, world!')\n    ```\n  </Tabs.Tab>\n</Tabs>\n````\n\n### React Component\n\n```jsx filename=\"tabs.jsx\"\nimport { Tabs } from 'nextra/components'\n\nconst items = ['1', '2', '3', '4']\nconst defaultIndex = 1\nconst Component = () => (\n  <Tabs items={items} defaultIndex={defaultIndex}>\n    <Tabs.Tab>1</Tab>\n    <Tabs.Tab>2</Tab>\n    <Tabs.Tab>3</Tab>\n    <Tabs.Tab>4</Tab>\n  </Tabs>\n)\nexport default Component\n```";
